export const convertEnumSdpTypes = (type) => {
    return type === 1 ? "offer" : type === 2 ? "pranswer" : type === 3 ? "answer" : "rollback"
}

export const convertEnumSdpTypesToNumbers = (type) => {
    return type === "offer" ? 1 : type === "pranswer" ? 2 : type === "answer" ? 3 : 4
}
